import { useParams } from "react-router-dom";

function Detail() {
  const { id } = useParams();
  const getMovie = async () => {
    const json = await await fetch(
      `https://yts.mx/api/v2/list_movies.json?minimum_rating=9&sort_by=id=${id}`
    ).json();
    console.log(json);
  };
  return <h1>Detail</h1>;
}

export default Detail;
